import React, { useState } from 'react';
import {
  Card,
  CardContent,
  Avatar,
  Typography,
  IconButton,
} from '@mui/material';
import FavoriteIcon from '@mui/icons-material/Favorite';
import ChatBubbleOutlineIcon from '@mui/icons-material/ChatBubbleOutline';
import SendIcon from '@mui/icons-material/Send';
import SaveIcon from '@mui/icons-material/Save';
import MoreHorizIcon from '@mui/icons-material/MoreHoriz';
import './Pagesstyle.css';
import StoryBar from '../component/Storybar';
import Rightbar from '../component/Rightbar';
import man from '../component/assets/Avatars/man.png';
import Leftbar from '../component/Leftbar';
import PostForm from '..//PostForm'; // Import PostForm component

function Home() {
  const [posts, setPosts] = useState([]);
  const [selectedImageUrl, setSelectedImageUrl] = useState(''); // State to store the selected image URL
  const [likes, setLikes] = useState(Array(posts.length).fill(false));

  const handlePost = (newPost) => {
    setPosts([newPost, ...posts]);
  };

  const toggleLike = (index) => {
    const updatedLikes = [...likes];
    updatedLikes[index] = !updatedLikes[index];
    setLikes(updatedLikes);
  };

  const handleDoubleClick = (index) => {
    const updatedLikes = [...likes];
    updatedLikes[index] = true;
    setLikes(updatedLikes);
  };

  // Callback function to update the selected image URL
  const handleImageUpload = (imageUrl) => {
    setSelectedImageUrl(imageUrl);
  };

  return (
    <div className="dd">
      <StoryBar />
      <Rightbar />
      <Leftbar onPost={handlePost} />

      {posts.map((post, index) => (
        <Card
          key={index}
          className="post"
          sx={{ color: 'white', backgroundColor: 'black' }}
        >
          <div className="post__header">
            <IconButton color="primary" className="post__dots">
              <MoreHorizIcon />
            </IconButton>
          </div>
          <div className="post__content">
            <div className="post__user-info">
              <Avatar
                className="post__avatar"
                alt={post.username}
                src="/static/images/avatar/1.jpg"
              />
              <div className="post__username">
                <Typography variant="subtitle2">{post.username}</Typography>
              </div>
            </div>
            <img
              className="post__image"
              src={post.imageUrl}
              alt={post.caption}
              onDoubleClick={() => handleDoubleClick(index)}
            />
          </div>
          <CardContent>
            <div className="post__buttons">
              <IconButton
                color={likes[index] ? 'error' : 'primary'}
                onClick={() => toggleLike(index)}
              >
                <FavoriteIcon />
              </IconButton>
              <IconButton color="primary">
                <ChatBubbleOutlineIcon />
              </IconButton>
              <IconButton color="primary">
                <SendIcon />
              </IconButton>
              <IconButton color="primary" className="post__save-icon">
                <SaveIcon />
              </IconButton>
            </div>
            {likes[index] && (
              <Typography variant="body2" color="error">
                1 like
              </Typography>
            )}
            <Typography variant="body2">
              <strong>{post.username}</strong> {post.caption}
            </Typography>
          </CardContent>
        </Card>
      ))}

      {/* Display the selected image */}
      {selectedImageUrl && (
        <img
          className="post__image"
          src={selectedImageUrl}
          alt="Selected Image"
        />
      )}

      {/* Render the PostForm component with the correct callback */}
      <PostForm onPost={handlePost} onImageUpload={handleImageUpload} />
    </div>
  );
}

export default Home;
